import React from 'react'
import './CreateListFooter.css';

const CreateListFooter = () => {
    return (
        <div>
        <footer className = "footer">
            <span className="text-muted">All Rights Reserved 2022</span>
        </footer>
    </div>
    )
}

export default CreateListFooter
